    SUM  += ctmp;
    C(11) = ctmp = Y(11)*3.57008335e-2;
    SUM  += ctmp;
    C(12) = ctmp = Y(12)*2.27221341e-2;
    SUM  += ctmp;
    C(13) = ctmp = Y(13)*3.33039255e-2;
    SUM  += ctmp;
    C(14) = ctmp = Y(14)*3.84050525e-2;
    SUM  += ctmp;
    C(15) = ctmp = Y(15)*3.56453112e-2;
    SUM  += ctmp;
    C(16) = ctmp = Y(16)*3.32556033e-2;
